import React from "react";
import { Card, CardContent, Typography, Button, TextField, Grid } from "@mui/material";

function OrderPage() {
  return (
    <Grid container spacing={3} justifyContent="center">
      <Grid item xs={12} md={6}>
        <Card>
          <CardContent>
            <Typography variant="h5" gutterBottom>
              Order Fuel Now
            </Typography>
            <TextField label="Name" variant="outlined" fullWidth margin="normal" />
            <TextField label="Phone Number" variant="outlined" fullWidth margin="normal" />
            <TextField label="Delivery Address" variant="outlined" fullWidth margin="normal" />
            <TextField label="Fuel Quantity (Litres)" type="number" variant="outlined" fullWidth margin="normal" />
            <Button variant="contained" color="primary" fullWidth size="large" style={{ marginTop: "16px" }}>
              Place Order
            </Button>
          </CardContent>
        </Card>
      </Grid>
    </Grid>
  );
}

export default OrderPage;
